import Navbar from './components/Navbar';
import './styles.css';
import { Route, Routes, BrowserRouter as Router } from 'react-router-dom';
import Inicio from './routes/Inicio';
import Nosotros from './routes/Nosotros';
import Contacto from './routes/Contacto';
import Servicios from './routes/Servicios';
import LoginRoute from './routes/LoginRoute'; // Modificado para LoginRoute
import Signup from './routes/Signup';
import GestiondeAlojamientos from './components/GestiondeAlojamientos'; // Nueva importación

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Inicio />} />
          <Route path="/nosotros" element={<Nosotros />} />
          <Route path="/servicios" element={<Servicios />} />
          <Route path="/contacto" element={<Contacto />} />
          <Route path="/login" element={<LoginRoute />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/gestion-de-alojamientos" element={<GestiondeAlojamientos />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
